const IDOLs={"#e22b30":"天海春香","#2743d2":"如月千早","#b4e04b":"星井美希","#d3dde9":"萩原雪歩","#f39939":"高槻やよい","#515558":"菊地真","#fd99e1":"水瀬伊織","#a6126a":"四条貴音","#01a860":"秋月律子","#9238be":"三浦あずさ","#ffe43f":"双海亜美・真美","#01adb9":"我那覇響","#ea5b76":"春日未来","#6495cf":"最上静香","#fed552":"伊吹翼","#92cfbb":"田中琴葉","#9bce92":"島原エレナ","#58a6dc":"佐竹美奈子","#454341":"所恵美","#5abfb7":"徳川まつり","#ed90ba":"箱崎星梨花","#eb613f":"野々原茜","#7e6ca8":"望月杏奈","#fff03c":"ロコ","#c7b83c":"七尾百合子","#7f6575":"高山紗代子","#b54461":"松田亜利沙","#e9739b":"高坂海美","#f7e78e":"中谷育","#bee3e3":"天空橋朋花","#554171":"ｴﾐﾘｰ ｽﾁｭｱｰﾄ","#afa690":"北沢志保","#e25a9b":"舞浜歩","#d1342c":"木下ひなた","#f5ad3b":"矢吹可奈","#788bc5":"横山奈緒","#f19557":"二階堂千鶴","#f1becb":"馬場このみ","#ee762e":"大神環","#7278a8":"豊川風花","#d7a96b":"宮尾美也","#eceb70":"福田のり子","#99b7dc":"真壁瑞希","#b63b40":"篠宮可憐","#f19591":"百瀬莉緒","#aeb49c":"永吉昴","#6bb6b0":"北上麗花","#efb864":"周防桃子","#d7385f":"ジュリア","#ebe1ff":"白石紬","#274079":"桜守歌織"},show=async e=>{let t,b;await e.start();try{t=parseInt(document.getElementById("PARAM_GRP_CNT").value),b=document.getElementById("target"),b.innerHTML=""}catch(e){throw console.error(e),e}const c=new Array;for(const e in IDOLs){const t=new Color;t.setFromHex(e),c.push(t)}const a=Color.sorted(c),f=Color.sorted(c,t);for(let e=0;e<Object.keys(IDOLs).length;e++){const t=[c[e].getHex(),a[e].getHex(),f[e].getHex()];var o=t.map(e=>`<td class="cell" style="background-color: ${e};">${IDOLs[e]}</td>`).reduce((e,t)=>e+t);b.innerHTML+=`<tr>${o}</tr>`}await e.finish()};